import React from 'react';
import './Card.css';

const card = ({ items }) => {
    console.log(items);
    return (
        <div className='App'>
            {items.map(book => (
                <div className='card-container' key={book.id}>
                     <div>  <span  >Title:</span>   { book.title }</div>
                    <img className='card-image' alt='dd' src={book.image} />
                </div>
            ))}
        </div>
    );

}

export default card
